import { useLocation } from 'react-router-dom';
import './style/info.css'

function Info () {
  const location = useLocation();
  const { team } = location.state;

  return (
    <div className='information'>
      <img  src={team.logo} style={ { width: '150px' } } alt="League logo"/>
      <h2>{team.name}</h2>
      <h3>{team.city}</h3>
      <h4>{team.founded}</h4>
      <p>{team.details}</p>
    </div>
  );
}

export default Info;
